import React, { useEffect, useState } from 'react';
import './TestResults.css';
import ABTestService from '../../services/api';
import { TestResultResponse } from '../../services/types';

interface TestResultProps {
  test_name: string | null;
}
const TestResult: React.FC<TestResultProps> = ({ test_name }) => {
  const [testResults, setTestResults] = useState<TestResultResponse | null>(null);

  useEffect(() => {
    const fetchTestResult = async () => {
      try {
        if (test_name) {
          const data = await ABTestService.fetchData(test_name);
          setTestResults(data);
        }
      } catch (error) {
        console.error('Error fetching test results:', error);
      }
    };

    fetchTestResult();
  }, [test_name]);

  if (!testResults) {
    return <div>Loading...</div>;
  }

  return (
    <div className="test-results">
      <h2>Test Results</h2>

      <p>{testResults.message}</p>

      <table className="results-table">
        <thead>
          <tr>
            <th></th>
            <th>Control Group</th>
            <th>Variant Group</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Click Through Rate</td>
            <td>{testResults.control_click_through_rate}</td>
            <td>{testResults.variant_click_through_rate}</td>
          </tr>
          <tr>
            <td>Total Clicks</td>
            <td>{testResults.control_total_clicks}</td>
            <td>{testResults.variant_total_clicks}</td>
          </tr>
          <tr>
            <td>Total Impressions</td>
            <td>{testResults.control_total_impressions}</td>
            <td>{testResults.variant_total_impressions}</td>
          </tr>
        </tbody>
      </table>

      <p>P Value: {testResults.p_value}</p>
      <p>Confidence Interval: {testResults.confidence_interval}</p>

      <h3>The Winner is: {testResults.winner}</h3>
      <p>
        {testResults.winner === 'Control'
          ? 'The Control group had a higher click-through rate, therefore, it is the winner.'
          : 'The Variant group had a higher click-through rate, therefore, it is the winner.'}
      </p>

      <p>Status: {testResults.status}</p>
    </div>
  );
};

export default TestResult;
